export default class ReadonlyMap<S = any, T = any> {
    protected _map: Map<S, T>;
    constructor(init?: [S, T][]);
    entries(): MapIterator<[S, T]>;
    forEach(iterator: (value: T, key: S, set: Map<S, T>) => void, arg?: unknown): void;
    get(key: S): T | undefined;
    has(key: S): boolean;
    keys(): MapIterator<S>;
    get size(): number;
    values(): MapIterator<T>;
}
